import React from "react";
import {
  LineChart,
  XAxis,
  YAxis,
  Tooltip,
  CartesianGrid,
  Line,
  Legend,
} from "recharts";

const data = [{"name":"Zekiye","°C": 25.61},{"name":"Zekiye","°C": 27.61},{"name":"Zekiye","°C": 21.61}
];

function Chart({ dataToDraw }) {
  return (
    <LineChart
      width={500}
      height={300}
      data={dataToDraw}
      margin={{
        top: 5, right: 30, left: 20, bottom: 5,
      }}
    >
      <CartesianGrid strokeDasharray="3 3" />
      <XAxis dataKey="name" />
      <YAxis />
      <Tooltip />
      <Legend />
      <Line type="monotone" dataKey="pv" stroke="#8884d8" activeDot={{ r: 8 }} />
      <Line type="monotone" dataKey="°C" stroke="#82ca9d" />
    </LineChart>
  );
}


export default Chart;
